Descripcion:
Que, el Hospital del Salvador necesita contar con un Convenio de Suministro de Pinzas de Cuerpo Extraño por 36 meses para Hospital del Salvador con la finalidad de satisfacer de manera adecuada y eficiente la labor asistencial; 

Que, por la cuantía determinada, la presente licitación se ubica en el tramo para aquellas contrataciones iguales o superiores a 100 UTM e inferiores a 1.000 UTM, en conformidad al Artículo 36º del Reglamento de la Ley Nº19.886;

Que, hechas las consultas respectivas, la provisión de Convenio de Suministro de Pinzas de Cuerpo Extraño por 36 meses para Hospital del Salvador no se encuentra disponible por Convenio Marco ofrecidos en el Sistema de Información de la Dirección de Compras, www.mercadopublico.cl;

Que, esta compra está vinculada al proyecto 1057489-95-PC25//INSUMOS CLINICOS, correspondiente al plan anual de compras del año 2025;
